A fundamentação da contratação reside na Política de Comunicação do Confea, aprovada em Plenário por meio da Decisão PL-0837/2024, e no Plano de Comunicação 2024-2026, que define as principais ações e metas para o triênio 2024-2026. O objetivo é fortalecer a imagem institucional do Confea, disseminar informações que ressaltam a importância da fiscalização do exercício profissional no Sistema Confea/Crea e Mútua, defender a atividade profissional e valorizar o profissional no cumprimento de seu papel perante a sociedade.

O Plano de Comunicação 2024-2026 está alinhado à política de comunicação do Confea e a documentos institucionais como a Agenda 2030 e a Estratégia Federal de Desenvolvimento.

A Gerência de Comunicação (GCO) tem por finalidade desenvolver e coordenar a gestão estratégica de comunicação institucional do Confea, visando ao fortalecimento da imagem do Sistema e à visibilidade de seus serviços, programas, planos e resultados à sociedade, atuando de forma transversal e, quando necessário, em parceria com a Gerência de Eventos (GEV).

A política de patrocínio do Confea busca agregar valor à marca e tem por objetivos:
Gerar identificação e reconhecimento do Confea por meio da iniciativa patrocinada;
Ampliar o relacionamento com públicos de interesse;
Divulgar posicionamentos, programas e políticas institucionais;
Agregar valor à marca Confea.

A proposta da CBIC para aquisição da cota de patrocínio (R$ 75.000,00) viabiliza a participação do Confea no X Seminário Jurídico da CBIC – 2025, que reunirá público qualificado (juristas, lideranças empresariais e formadores de opinião) e oferece contrapartidas objetivas de visibilidade e relacionamento, conforme especificado neste Termo de Referência.

A participação do Confea é estratégica para reforçar seu papel institucional, fortalecer sua presença junto a públicos especializados, promover a valorização profissional e contribuir para o ambiente regulatório do setor da construção, com foco em segurança jurídica, boa regulação e transparência.
